import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import TypeBar from "../components/TypeBar.tsx";

const Shop = () => {
  return (
    <Container>
      <Row>
        <Col md={3}>
          <TypeBar />
        </Col>
      </Row>
    </Container>
  );
};

export default Shop;
